import React from "react";
import './../styles/ReadyOrder.scss'

const ReadyOrder = () => {
  return (
    <div className="order-ready">
      <div>
        <p>Номер вашего заказа №123123, с Вами свяжется наш менеджер.</p>
      </div>
    </div>
  );
};

export default ReadyOrder;
